import java.util.Scanner;

public class Main {
    static final int MAX_H = 5;
    static final int MAX_W = 5;
    static final int MAX_N = 100;

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int T = 1;
        while (T-- > 0) {
            int h = scanner.nextInt();
            int w = scanner.nextInt();
            char[][] initial = new char[h][w];
            char[][] target = new char[h][w];
            for (int i = 0; i < h; i++) {
                initial[i] = scanner.next().toCharArray();
                target[i] = scanner.next().toCharArray();
            }
            System.out.println(solve(h, w, initial, target));
        }
    }

    static double solve(int h, int w, char[][] initial, char[][] target) {
        double[][][][] dp = new double[h + 1][w + 1][h + 1][w + 1];
        for (int i = 0; i <= h; i++) {
            for (int j = 0; j <= w; j++) {
                for (int x = 0; x <= h; x++) {
                    for (int y = 0; y <= w; y++) {
                        dp[i][j][x][y] = 0;
                    }
                }
            }
        }
        for (int i = 0; i <= h; i++) {
            for (int j = 0; j <= w; j++) {
                dp[i][j][i][j] = 1;
            }
        }
        for (int i = h; i >= 1; i--) {
            for (int j = w; j >= 1; j--) {
                for (int x = i; x >= 1; x--) {
                    for (int y = j; y >= 1; y--) {
                        if (initial[x - 1][y - 1] == target[x - 1][y - 1]) {
                            dp[i][j][x][y] = dp[i][j][x + 1][y + 1];
                        } else {
                            dp[i][j][x][y] = (1.0 / (i * j)) * (i * dp[i][j][x + 1][y + 1] + j * dp[i][j][x][y + 1] - (x * dp[i][j][x + 1][y] + y * dp[i][j][x][y + 1]) + (x * y * (i - x) * (j - y)));
                        }
                    }
                }
            }
        }
        return dp[1][1][h][w];
    }
}
